import axios from 'axios';
import * as CONSTANTS from '../constants';

export const userDetailsService = async (body) => {
  try {
    const { data } = await axios.get(`${CONSTANTS.BaseApi}${CONSTANTS.users}`,body);
    return data
  } catch (error) {
      throw error
  }
};
